const LikedPhotoGrid = ({ photos, username }) => {
    return (
        <div className="photo-grid">
            {photos.map((photo) => (
                <div key={photo.id} className="photo-item">
                    <img src={photo.urls.regular} />
                </div>
            ))}
        </div>
    );
};

export default LikedPhotoGrid;
